import { styled } from "styled-components";

const ContainerHeader = styled.div`
.Header{
  position: fixed;
  background-color: blue;
  min-width: 100%;
  min-height: 80px;
  margin-top: -100px;
  display: flex;
  flex-direction: column;
  align-items: center;
}
p{
    margin-left: 100px;
}
`;

export {ContainerHeader}
